CustomCSS:
/* Retro CRT/Terminal Theme for BetterSEQTA+ */
/* Amber phosphor aesthetic with scanlines - uses --better-main for accent (change to green phosphor etc.) */

:root {
  --retro-bg: #0a0a0a;
  --retro-bg-elevated: #0d0d0d;
}

/* Dark mode required - force dark backgrounds */
html.dark body,
html.dark #container,
html.dark #main {
  font-family: Consolas, "Courier New", monospace !important;
  font-size: 13px !important;
}

/* Container - very dark */
#container {
  background: var(--retro-bg) !important;
}

/* Title bar - dark with amber accent */
#title {
  background: var(--retro-bg-elevated) !important;
  color: var(--better-main) !important;
  border-bottom: 1px solid var(--better-main) !important;
  box-shadow: 0 0 10px color-mix(in srgb, var(--better-main) 20%, transparent) !important;
}

#title * {
  color: var(--better-main) !important;
}

/* Sidebar menu */
#menu {
  background: var(--retro-bg-elevated) !important;
  border-right: 1px solid var(--better-main) !important;
  color: var(--better-main) !important;
}

#menu li:hover,
#menu section:hover {
  background: color-mix(in srgb, var(--better-main) 10%, transparent) !important;
}

#menu li.active,
#menu section.active {
  background: color-mix(in srgb, var(--better-main) 15%, transparent) !important;
  box-shadow: inset 0 0 20px color-mix(in srgb, var(--better-main) 5%, transparent) !important;
}

#menu * {
  color: var(--better-main) !important;
}

/* Main content - with optional CRT scanline overlay */
#main {
  background: var(--retro-bg) !important;
  color: var(--better-main) !important;
  position: relative;
}

/* Subtle scanline effect overlay */
#main::after {
  content: "";
  position: fixed;
  top: 0;
  left: 0;
  right: 0;
  bottom: 0;
  background: repeating-linear-gradient(
    0deg,
    transparent,
    transparent 2px,
    rgba(0, 0, 0, 0.15) 2px,
    rgba(0, 0, 0, 0.15) 4px
  );
  pointer-events: none;
  z-index: 9998;
}

/* Dashboard sections - dark with thin amber border */
#main > .dashboard section,
.dashlet,
.notice,
.document {
  background: var(--retro-bg-elevated) !important;
  border: 1px solid var(--better-main) !important;
  border-radius: 0 !important;
  box-shadow: 0 0 15px color-mix(in srgb, var(--better-main) 10%, transparent) !important;
  color: var(--better-main) !important;
}

.dashlet *,
.notice *,
.document * {
  color: var(--better-main) !important;
}

/* Buttons - retro minimal */
.uiButton,
.addedButton,
[class*="uiButton"] {
  background: var(--retro-bg-elevated) !important;
  border: 1px solid var(--better-main) !important;
  border-radius: 0 !important;
  color: var(--better-main) !important;
}

.uiButton:hover,
.addedButton:hover {
  background: color-mix(in srgb, var(--better-main) 10%, transparent) !important;
  box-shadow: 0 0 10px color-mix(in srgb, var(--better-main) 20%, transparent) !important;
}

/* Quickbar */
.quickbar {
  background: var(--retro-bg-elevated) !important;
  border: 1px solid var(--better-main) !important;
  color: var(--better-main) !important;
}

/* Day containers */
.day {
  background: var(--retro-bg-elevated) !important;
  border: 1px solid var(--better-main) !important;
  border-radius: 0 !important;
  color: var(--better-main) !important;
}

/* Shortcuts */
.shortcut {
  background: var(--retro-bg-elevated) !important;
  border: 1px solid var(--better-main) !important;
  border-radius: 0 !important;
  color: var(--better-main) !important;
}

.shortcut:hover {
  box-shadow: 0 0 10px color-mix(in srgb, var(--better-main) 20%, transparent) !important;
}

/* Inputs */
input,
select,
textarea {
  background: var(--retro-bg) !important;
  border: 1px solid var(--better-main) !important;
  border-radius: 0 !important;
  color: var(--better-main) !important;
}

input::placeholder,
textarea::placeholder {
  color: var(--better-light) !important;
}

/* Links */
a {
  color: var(--better-main) !important;
}

a:hover {
  text-shadow: 0 0 8px var(--better-main) !important;
}

/* Home container */
.home-container {
  background: var(--retro-bg) !important;
}

/* Timetable container */
.timetable-container {
  background: var(--retro-bg-elevated) !important;
  border: 1px solid var(--better-main) !important;
}

/* Calendar */
.calendar {
  background: var(--retro-bg-elevated) !important;
  border: 1px solid var(--better-main) !important;
}

/* Upcoming assessments */
.upcoming-assessment {
  background: var(--retro-bg-elevated) !important;
  border: 1px solid var(--better-main) !important;
}
